import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate('/productList');
  };

  return (
    <div>
      <h1>홈 화면</h1>
      <button onClick={handleClick}>Product List로 이동</button>
    </div>
  );
}

export default Home;
